import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monster1: {
        name: 'Linda',
      },
      monster2: {
        name: 'Frank',
      },
      monster3: {
        name: 'Jacky',
      },
    };
  }
  render() {
    return (
      <div className="App">
        {this.state.array.forEach((element) => {
          <h1>{element.name}</h1>;
        })}
      </div>
    );
  }
}

export default App;
